import React from "react";


function StartPage() {
  return (
    <div>
      <h1>Welcome to the Website</h1>
      <div>
          <button href="/Login">Login</button>
          <button href="SignUp">Sign Up</button>

      </div>
    </div>
  );
}

export default StartPage;
